import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService";

class Movies extends Component {
  state = { movies: getMovies() };
  render() {
    return (
      <div>
        <h1>hello Movies!</h1>
        <table>
          <tr key={0}>
            <td key={1}>Title</td>
            <td key={2}>Genre</td>
            <td key={3}>Stock</td>
            <td key={4}>Rate</td>
          </tr>
          <tbody>
            {this.state.movies.map((mov) => this.generateMovie(mov))}
          </tbody>
        </table>
      </div>
    );
  }

  generateMovie(movie) {
    return (
      <tr key={movie.id}>
        <td>{movie.title}</td>
        <td>{movie.genre.name}</td>
        <td>{movie.numberInStock}</td>
        <td>{movie.dailyRentalRate}</td>
      </tr>
    );
  }
}

export default Movies;
